import React, { Component } from "react";
import suit from "../img/suit.png";
import PopulatePhoto from "./PopulatePhoto";
import all from "../img/all.png";
import legacy from "../img/legacy.png";
import video from "../img/movie.png";
import original from "../img/original.png";
import returnImg from "../img/return.png";
import { Link } from "react-router-dom";

class Vis extends Component {
  constructor(props) {
    super(props);
    this.state = { filter: 0 };
    this.handleMenu = this.handleMenu.bind(this);
  }

  handleMenu(type) {
    this.setState({ filter: type });
    console.log(this.state);
  }
  render() {
    return (
      <div>
        <div className="returnDiv">
          <Link to="/" className="linkStyle">
            <img src={returnImg} alt="return" className="returnIcon" />
          </Link>
        </div>
        <p className="pageTitle">visuals</p>
        <div className="topBar">
          <a className="subMenu">
            <img
              src={all}
              alt="all"
              className="menuIcon"
              onClick={() => this.handleMenu(0)}
            />
          </a>
          <a className="subMenu">
            <img
              src={all}
              alt="all"
              className="menuIcon"
              onClick={() => this.handleMenu(1)}
            />
          </a>
          <a className="subMenu">
            <img
              src={legacy}
              alt="legacy"
              className="menuIcon"
              onClick={() => this.handleMenu(2)}
            />
          </a>
          <a className="subMenu">
            <img
              src={video}
              alt="video"
              className="menuIcon"
              onClick={() => this.handleMenu(3)}
            />
          </a>
          <a className="subMenu">
            <img
              src={original}
              alt="homegrown"
              className="menuIcon"
              onClick={() => this.handleMenu(4)}
            />
          </a>
        </div>
        <PopulatePhoto filter={this.state.filter} />
      </div>
    );
  }
}
export default Vis;
